public class Solution {
    public int maxProduct(int[] nums) {
    	int ans = Integer.MIN_VALUE;
        int[][] subarrprod = new int[nums.length][nums.length];
        for(int i=0;i<nums.length;i++){
        	subarrprod[i][i] = nums[i];
        }
        for(int i=0;i<nums.length;i++){
        	for(int len = 2;len+i-1<nums.length;len++){
        		subarrprod[i][i+len-1] = subarrprod[i][i+len-2]*nums[i+len-1];
        		if(subarrprod[i][i+len-1]>ans) ans = subarrprod;
        	}
        }
        return ans;        
    }
}

