public class Solution {
    public int maxProduct(int[] nums) {
        int n = nums.length;
        if(n==0) return 0;
        int[] startmin = new int[n];
        int[] startmax = new int[n];
        int[] all = new int[n];
        startmin[n-1] = startmax[n-1] = all[n-1] = nums[n-1];
        for(int i=n-2;i>=0;i--){
            if(nums[i]>=0){
                startmin[i] = min(startmin[i+1]*nums[i],nums[i]);
                startmax[i] = max(startmax[i+1]*nums[i],nums[i]);
            }else{
                startmin[i] = min(startmax[i+1]*nums[i],nums[i]);
                startmax[i] = max(startmin[i+1]*nums[i],nums[i]);
            }
            all[i] = max(all[i+1],startmax[i]);
        }       
        return all[0];        
    }
    public int min(int a,int b){
        return a<b?a:b;
    }
    public int max(int a,int b){
        return a>b?a:b;
    }
}

